import AppLayout from "../components/AppLayout";
import Head from 'next/head';
import { Descriptions } from 'antd';

const Profile = () => {
    return (
        <>
            <Head>
                <title>프로필</title>
            </Head>
            <AppLayout>
                <Avatar
                    style={{
                        backgroundColor: color,
                        verticalAlign: 'middle',
                    }}
                    size="large"
                    gap={gap}
                >
                    By
                </Avatar>
                <Descriptions title="By-Juun(안병준)">
                    <Descriptions.Item label="한줄소개" style={{ display: "inline-block" }}>JavaScript를 사랑하는 개발자</Descriptions.Item>
                    <Descriptions.Item label="Github "><a href="https://github.com/BY-juun">https://github.com/BY-juun</a></Descriptions.Item>
                </Descriptions>
            </AppLayout>
        </>
    );
}

export default Profile;
